func sendRequest(host string) ([]byte, error) {
	// Request (GET https://tools.ipip.net/ping.php?v=4&a=send&host=www.win.one&area%5B%5D=china)

	// Create client
	client := &http.Client{}

	// Create request
	req, err := http.NewRequest("GET", fmt.Sprintf("https://tools.ipip.net/ping.php?v=4&a=send&host=%s&area[]=china", host), nil)

	// Headers
	//req.Header.Add("Cookie", "__jsluid=8c47232528b8bb7ebb73802efbb20307")

	parseFormErr := req.ParseForm()
	if parseFormErr != nil {
		fmt.Println(parseFormErr)
	}

	// Fetch Request
	resp, err := client.Do(req)

	if err != nil {
		return nil, err
	}
	defer resp.Body.Close()

	// Read Response Body
	respBody, _ := ioutil.ReadAll(resp.Body)

	return respBody, nil
}

func parse(data []byte) {
	fields := bytes.Split(data, []byte("</script>"))
	for i := range fields {
		fields[i] = bytes.TrimPrefix(bytes.TrimSuffix(fields[i], []byte("</script>")), []byte("<script>"))
	}
	result := make([]*Area, 0, len(fields)/2)
	for _, field := range fields {
		if bytes.HasPrefix(field, []byte("parent.call_ping(")) {
			field = bytes.TrimSuffix(bytes.TrimPrefix(field, []byte("parent.call_ping(")), []byte(");"))
			area := &Area{}
			json.Unmarshal(field, area)
			result = append(result, area)
		}

	}
	for _,area:=range result{
		fmt.Printf("{name:'%s',value:%s,tooltip:'%s'},\n",area.GetName(),area.RttAverage,area.Name)
	}
}

type Area struct {
	Id         int    `json:"id"`
	Name       string `json:"name"`
	Ip         string `json:"ip"`
	IpArea     string `json:"ip_area"`
	Text       string `json:"text"`
	Loss       string `json:"loss"`
	RttMin     string `json:"rtt_min"`
	RttMax     string `json:"rtt_max"`
	RttAverage string `json:"rtt_avg"`
	RttMdev    string `json:"rtt_mdev"`
	Ttl        string `json:"ttl"`
	LinkName   string `json:"link_name"`
	LinkUrl    string `json:"link_url"`
}
func (a Area) String() string{
	builder:=&strings.Builder{}

	fmt.Fprintf(builder,"id=%d ,name=%s, ip=%s ,ipArea=%s, loss=%s, rtt[ min=%s max=%s avg=%s mdev=%s] ttl=%s link[ name=%s ulr=%s] text=\n%s",a.Id,a.Name,a.Ip,a.IpArea,a.Loss,a.RttMin,a.RttMax,a.RttAverage,a.RttMdev,a.Ttl,a.LinkName,a.LinkUrl,a.Text)
	return builder.String()
}

func (a Area) GetName() string{
	index:=strings.IndexAny(a.Name,"(（")
	if index!=-1{
		a.Name=a.Name[:index]
	}
	suffixes:=[]string{"电信","联通","BGP","鹏博士","移动","铁通"}

	for _,suffix:=range suffixes{
		if strings.HasSuffix(a.Name,suffix){
			a.Name=strings.TrimSuffix(a.Name,suffix)
			break
		}
	}

	for _,province:=range provinces{
		if strings.HasPrefix(a.Name,province){
			a.Name=strings.TrimPrefix(a.Name,province)
			break
		}
	}
	return a.Name+"市"
}